import React, { Component } from 'react';
import { TwitterFollowButton } from 'react-twitter-embed';
import Script from 'react-load-script';

import {
  TwitterCtaContainer,
  TwitterCtaImage,
  TwitterCtaContent,
  TwitterCtaTitle,
  TwitterCtaDescription,
  TwitterProfileContainer
} from './styled';

class TwitterCta extends Component {
  
  state = {
    scriptLoaded: false
  }

  handleScriptCreate() {
    this.setState({ scriptLoaded: false })
  }
   
  handleScriptError() {
    this.setState({ scriptError: true })
  }
   
  handleScriptLoad() {
    this.setState({ scriptLoaded: true })
  }

  render() {
    const { scriptLoaded } = this.state;
    return (
      <TwitterCtaContainer>
        <TwitterProfileContainer>
          <TwitterCtaImage alt="Picture of Kyle McDonald" src="data:image/jpeg;base64,"/>
          <TwitterCtaContent>
            <TwitterCtaTitle>
              Thanks for reading!
            </TwitterCtaTitle>
            <TwitterCtaDescription>
              Follow me on Twitter to stay up to date on my latest posts!
            </TwitterCtaDescription>
            <TwitterFollowButton
              screenName={'designbykyle'}
            />
          </TwitterCtaContent>
        </TwitterProfileContainer>
        {scriptLoaded && <div id="codefund_ad"></div>}
        <Script
          url="https://codefund.io/scripts/e0eb3bf9-38b2-41b0-bc97-1f16e94abb38/embed.js"
          onCreate={this.handleScriptCreate.bind(this)}
          onError={this.handleScriptError.bind(this)}
          onLoad={this.handleScriptLoad.bind(this)}
        />
      </TwitterCtaContainer>
    );
  }
}

export default TwitterCta;
